window.addEventListener("resize", changeColumnNumbers);

function checkColumnsNumber() {
    let number = 0;
    flexColumns.forEach((item) => {
        if (getComputedStyle(item).display == "flex") {
            number++;
        }
    });
    return number;
}

function changeColumnNumbers() {
    const columnNumbers = checkColumnsNumber();
    flexColumns.forEach((item) => {
        item.textContent = "";
    });

    let columnIndex = 0;
    for (let i = 0; i < imageTable.length; i++) {
        const newImg = document.createElement("img");
        newImg.src = imageTable[i].src;
        newImg.addEventListener("click", setImageDataToLocalStorage);
        newImg.addEventListener("click", copyMessageAnimation);
        newImg.classList.add("pointer");
        flexColumns[columnIndex].appendChild(newImg);

        columnIndex++;
        if (columnIndex % columnNumbers == 0) {
            columnIndex = 0;
        }
    }
}

function setImageDataToLocalStorage() {
    let indexOfSearchedItem;
    imageTable.forEach((item, index) => {
        if (item.src == this.getAttribute("src")) {
            indexOfSearchedItem = index;
        }
    });
    sessionStorage.setItem("copiedData", JSON.stringify(imageTable[indexOfSearchedItem]));
}

function copyMessageAnimation() {
    const copyMessage = document.querySelector(".copyMessage");
    copyMessage.classList.remove("copyMessageAnimationTrigger");
    setTimeout(() => {
        copyMessage.classList.add("copyMessageAnimationTrigger");
    }, 100);
}
